snippet.description:
EternAlgoRhythm is a 10-key rhythm game with procedurally generated music and tracks. Here's a mix of  some of its tracks, for extended versions check out the EternAlgoRhyth playlist; 
https://www.youtube.com/playlist?list=PLGC7JEgOH2UmWEoBFAYahfwIxhjSDYp9L

This game has a free demo! While the main game will contain many more collections, the demo has the ability to use the editor to create your own tracks, and play any tracks made by the community.

